<div class="f2-page-header-bordered">
    <button
        class="f2-button f2-back f2-small"
        (click)="goBack()"
    >
        Back
    </button>
    <app-f2-datepicker
        class="f2-datepicker-container"
        (valueChange)="onChangeDateRange($event)"
    />
</div>
<app-paginated-table
    class="mt30 mb30 ml30 mr30"
    [options]="tableOptions"
></app-paginated-table>
